import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import axios from 'axios';
import './Style.css';

function First() {
    const [team, setTeam] = useState('');
    const [date, setDate] = useState('');
    const navigate = useNavigate();

    const handleSubmit = () => {
        axios.get('http://localhost:8070/router/get', {
            params: { team, date }
           
        })
        .then(response => {
            navigate('/Third',{ state: { data: response.data } });
          
        })
        .catch(error => {
            console.error('There was an error!', error);
        });
    };

    return (
        <div class="bg-secondary">
            <label class="form-label team">Team</label>
            <input type="text" class="form-control team" name="team" value={team} onChange={(e) => setTeam(e.target.value)} /> <br/>
            
            <label class="form-label date">Date</label>
            <input type="date"class="form-control date" name="date" value={date} onChange={(e) => setDate(e.target.value)} /> <br/>
            
             <button type="button" class="btn btn-outline-light start"onClick={handleSubmit}>Search</button><br/>
             <button type="button" class="btn btn-outline-light start"onClick={() => navigate('/Second')}>Start</button>
        </div>
    );
}

export default First;
